ico, como uma imagem ou fonte, estiver ausente.','Skip 404 saved'=>'Ignorar 404 guardado','Image Optimization'=>'Otimização de Imagens','We automatically optimize your uploaded images to WebP format for faster performance and reduced file sizes. You can also choose to delete the original images to save storage space.'=>'Otimizamos automaticamente suas imagens carregadas para o formato WebP para melhor desempenho e redução do tamanho dos arquivos. Você também pode optar por excluir as imagens originais para economizar espaço de armazenamento.','Enable Image Optimization'=>'Habilitar otimização de imagens','Enable or disable image optimization globally.'=>'Ativar ou desativar a otimização de imagens globalmente.','Automatically Optimize Uploaded Images'=>'Otimizar automaticamente imagens carregadas','When enabled, all your new image uploads will be automatically optimized to WebP format, ensuring faster page loading and reduced file sizes.'=>'Quando ativado, todas as suas novas imagens carregadas serão automaticamente otimizadas para o formato WebP, garantindo carregamento de página mais rápido e redução do tamanho dos arquivos.','Auto Delete Original Image'=>'Deletar automaticamente a imagem original','When enabled, the original uploaded image is deleted and replaced with the optimized version, helping to save storage space. If disabled, the optimized image is saved as a separate file, retaining the original.'=>'Quando ativado, a imagem original carregada é excluída e substituída pela versão otimizada, ajudando a economizar espaço de armazenamento. Se desativado, a imagem otimizada é salva como um arquivo separado, mantendo a original.','No settings available.'=>'Nenhuma configuração disponível.','Oops! Something went wrong. Please try again.'=>'Oops! Algo deu errado. Tente novamente.','Loading settings…'=>'Carregando configurações…','Settings updated successfully'=>'Configurações atualizadas com sucesso','Your image optimization settings have been saved.'=>'Suas configurações de otimização de imagem foram salvas.','Enable Lazy Loading'=>'Ativar Carregamento Preguiçoso','Lazy loading defers the loading of images until they are visible on the screen, improving page load speed and performance.'=>'O carregamento preguiçoso adia o carregamento das imagens até que elas fiquem visíveis na tela, melhorando a velocidade de carregamento da página e o desempenho.','Lazy loading has been updated.'=>'O carregamento preguiçoso foi atualizado.','Oops! There was an error updating the lazy loading settings.'=>'Oops! Ocorreu um erro ao atualizar as configurações de carregamento lento.','Enable Bulk Optimization of Images'=>'Ativar Otimização em Massa de Imagens','When enabled, allows bulk optimization of images in the media library.'=>'Quando ativado, permite a otimização em massa de imagens na biblioteca de mídia.','Go to Media Library'=>'Ir para a Biblioteca de Mídia','Error Updating Settings'=>'Erro ao Atualizar Configurações','Prefer Optimized Image When Exists'=>'Preferir Imagem Otimizada Quando Existir','When enabled, optimized images will be served in place of original images when they exist, improving performance.'=>'Quando ativado, as imagens otimizadas serão servidas no lugar das imagens originais quando existirem, melhorando o desempenho.','Something went wrong while updating the settings. Please try again.'=>'Algo deu errado durante a atualização das configurações. Por favor, tente novamente.','Asks the browser to download and cache links on the page ahead of them being clicked on, so that when they are clicked they load almost instantly.'=>'Solicita ao navegador que baixe e armazene em cache os links na página antes de serem clicados, para que, quando clicados, eles carreguem quase instantaneamente.','Link prefetching setting saved'=>'Configurações de pré-carregamento de links salvas','Link Prefetch'=>'Pré-carregamento de links','Enable link prefetching on desktop'=>'Ativar o pré-carregamento de links no desktop','Activate on desktop'=>'Ativar no desktop','Behavior of the prefetch'=>'Comportamento do pré-carregamento','Behavior'=>'Comportamento','Prefetch on Mouse Down'=>'Pré-carregar ao pressionar o mouse','Prefetch on Mouse Down: Starts loading the page as soon as you click down, for faster response when you release the click.'=>'Pré-carregar ao Clicar: Inicia o carregamento da página assim que você clica, para uma resposta mais rápida quando soltar o clique.','Prefetch on Mouse Hover (Recommended)'=>'Pré-carregar ao passar o mouse (Recomendado)','Prefetch on Mouse Hover: Begins loading the page the moment your cursor hovers over a link'=>'Pré-carregar ao passar o mouse: começa a carregar a página no momento em que o cursor passa sobre um link','Enable link prefetching on mobile'=>'Ativar o pré-carregamento de links no mobile','Activate on mobile'=>'Ativar no mobile','Prefetch on Touchstart (Recommended)'=>'Pré-carregar ao tocar (Recomendado)','Prefetch on Touchstart: Instantly starts loading the page as soon as you tap the screen, ensuring a quicker response when you lift your finger.'=>'Pré-carregar ao tocar na tela: começa a carregar a página instantaneamente assim que você toca na tela, garantindo uma resposta mais rápida quando você levantar o dedo.','Prefetch Above the Fold'=>'Pré-carregar acima da dobra','Prefetch Above the Fold: Loads links in your current view instantly, ensuring they\'re ready when you need them.'=>'Pré-carregar acima da dobra: carrega os links na sua visão atual instantaneamente, garantindo que eles estejam prontos quando você precisar.','Exclude Keywords: A comma separated list of words or strings that will exclude a link from being prefetched. For example, excluding "app" will prevent https://example.com/apple from being prefetched.'=>'Excluir palavras-chave: uma lista separada por vírgulas de palavras ou cadeias de caracteres que excluirão um link de ser pré-carregado. Por exemplo, excluir ‘app’ impedirá que https://example.com/apple seja pré-carregado.','Exclude keywords'=>'Excluir palavras-chave','Advanced settings'=>'Configurações avançadas','Additional speed and scalability features powered by Jetpack Boost to make your site as fast as it can be.'=>'Recursos adicionais de velocidade e escalabilidade impulsionados pelo Jetpack Boost para tornar o seu site o mais rápido possível.','Optimize Critical CSS Loading (manual)'=>'Otimizar o carregamento de CSS crítico (manual)','Move important styling information to the start of the page, which helps pages display your content sooner, so your users don’t have to wait for the entire page to load.'=>'Mova as informações de estilo importantes para o início da página, o que ajuda as páginas a exibir seu conteúdo mais rapidamente, para que seus usuários não precisem esperar o carregamento de toda a página.','Optimize Critical CSS Loading (UPGRADED)'=>'Otimizar o carregamento de CSS crítico (ATUALIZADO)','Generate Critical CSS Automatically'=>'Gerar CSS crítico automaticamente','Move important styling information to the start of the page, which helps pages display your content sooner, so your users don’t have to wait for the entire page to load.%1$s %2$sBoost will automatically generate your Critical CSS%3$s whenever you make changes to the HTML or CSS structure of your site.'=>'Mova informações de estilo importantes para o início da página, o que ajuda as páginas a exibir seu conteúdo mais rapidamente, para que seus usuários não precisem esperar o carregamento completo da página.%1$s %2$sO Boost gerará automaticamente seu CSS Crítico%3$s sempre que você fizer alterações na estrutura HTML ou CSS do seu site.','Defer Non-Essential JavaScript'=>'Atrasar o carregamento de JavaScript não essencial','Run non-essential JavaScript after the page has loaded so that styles and images can load more quickly.'=>'Executar JavaScript não essencial após o carregamento da página, para que os estilos e as imagens possam carregar mais rapidamente.','Concatenate JS'=>'Concatenar JS','Scripts are grouped by their original placement, concatenated and minified to reduce site loading time and reduce the number of requests.'=>'Os scripts são agrupados conforme sua colocação original, concatenados e minificados para reduzir o tempo de carregamento do site e diminuir o número de requisições.','Exclude JS Strings'=>'Excluir strings de JS','Concatenate CSS'=>'Concatenar CSS','Styles are grouped by their original placement, concatenated and minified to reduce site loading time and reduce the number of requests.'=>'Os estilos são agrupados conforme sua colocação original, concatenados e minificados para reduzir o tempo de carregamento do site e diminuir o número de requisições.','Exclude CSS Strings'=>'Excluir strings de CSS','Show more'=>'Mostrar mais','Show less'=>'Mostrar menos','Discover More'=>'Descubra mais','Install Jetpack Boost to unlock'=>'Instale o Jetpack Boost para desbloquear','Installing Jetpack Boost…'=>'Instalando o Jetpack Boost…','Jetpack Boost is now active'=>'O Jetpack Boost está agora ativo','Activation failed'=>'Ativação falhou','Discover more %1$shere%2$s'=>'Descubra mais %1$saqui%2$s','Option saved correctly'=>'Opção salva corretamente','Error saving option'=>'Erro ao salvar opção','Upgrade to unlock'=>'Faça um upgrade para ter acesso','Autosave Interval'=>'Intervalo de Salvamento Automático','Autosaving is set to happen every 30 seconds or more'=>'O salvamento automático está configurado para ocorrer a cada 30 segundos ou mais','Autosaving is set to be frequent, less than every 30 seconds'=>'O salvamento automático está configurado para ser frequente, menos de 30 segundos','Setting the autosave interval to a longer period can reduce server load. It is recommended to set it to 30 seconds or more.'=>'Definir o intervalo de salvamento automático para um período mais longo pode reduzir a carga do servidor. Recomenda-se defini-lo para 30 segundos ou mais.','Browser Caching'=>'Cache do Navegador','Browser caching is enabled'=>'O cache do navegador está ativado','Browser caching is disabled'=>'O cache do navegador está desativado','Enabling browser caching can improve performance by storing static assets in the browser for faster page loads.'=>'Ativar o cache do navegador pode melhorar o desempenho armazenando ativos estáticos no navegador para carregamentos de página mais rápidos.','Cloudflare enabled'=>'Cloudflare ativado','Cloudflare integration is enabled'=>'A integração com o Cloudflare está ativada','Cloudflare integration is disabled'=>'A integração com o Cloudflare está desativada','Cloudflare integration can improve performance and security.'=>'A integração com o Cloudflare pode melhorar o desempenho e a segurança.','CSS files are concatenated'=>'Arquivos CSS estão concatenados','CSS files are not concatenated'=>'Arquivos CSS não estão concatenados','Concatenating CSS can improve performance by reducing the number of requests.'=>'Concatenar CSS pode melhorar o desempenho, reduzindo o número de solicitações.','Concatenate JavaScript'=>'Concatenar JavaScript','JavaScript files are concatenated'=>'Arquivos JavaScript estão concatenados','JavaScript files are not concatenated'=>'Arquivos JavaScript não estão concatenados','Concatenating JavaScript can improve performance by reducing the number of requests.'=>'Concatenar JavaScript pode melhorar o desempenho, reduzindo o número de solicitações.','WP Cron Lock Timeout'=>'Tempo Limite de Bloqueio do WP Cron','Cron lock timeout is set to 60 seconds or less.'=>'O tempo limite de bloqueio do Cron está definido para 60 segundos ou menos.','Cron lock timeout is set to a high number.'=>'O tempo limite de bloqueio do Cron está definido para um número alto.','Cron lock timeout affects how long a cron job can run for. Setting it to a lower number can improve performance.'=>'O tempo limite de bloqueio do Cron afeta por quanto tempo um trabalho cron pode ser executado. Definir para um número menor pode melhorar o desempenho.','Non-essential JavaScript is deferred'=>'JavaScript não essencial está adiado','Non-essential JavaScript is not deferred'=>'JavaScript não essencial não está adiado','JavaScript can be deferred to improve performance by loading it after the page has loaded.'=>'O JavaScript pode ser adiado para melhorar o desempenho, carregando-o depois que a página for carregada.','Empty Trash Days'=>'Dias para Esvaziar a Lixeira','Trash is emptied every 30 days or less'=>'A lixeira é esvaziada a cada 30 dias ou menos','Trash is emptied less frequently than every 30 days.'=>'A lixeira é esvaziada com menos frequência do que a cada 30 dias.','Emptying the trash more frequently can reduce database bloat.'=>'Esvaziar a lixeira com mais frequência pode reduzir o inchaço do banco de dados.','Lazy Loading'=>'Carregamento Lento','Lazy loading is enabled'=>'Carregamento lento está ativado','Lazy loading is disabled'=>'Carregamento lento está desativado','Lazy loading can improve performance by only loading images when they are in view.'=>'O carregamento lento pode melhorar o desempenho carregando imagens apenas quando elas estão visíveis.','Link Prefetching'=>'Pré-busca de Links','Link prefetching is enabled'=>'Pré-busca de links está ativada','Link prefetching is disabled'=>'Pré-busca de links está desativada','Link prefetching can improve performance by loading pages immediately before they are requested.'=>'A pré-busca de links pode melhorar o desempenho carregando páginas imediatamente antes de serem solicitadas.','Page Caching'=>'Cache de Página','Page caching is enabled'=>'Cache de página está ativado','Page caching is disabled'=>'Cache de página está desativado','Page caching can improve performance by bypassing PHP and database queries for faster page loads.'=>'O cache de página pode melhorar o desempenho, ignorando as consultas de PHP e do banco de dados para carregamentos de página mais rápidos.','Permalinks'=>'Links Permanentes','Permalinks are pretty'=>'Links permanentes estão otimizados','Permalinks are not set up'=>'Links 